import React from 'react';

const TeamDetail = () => {
  return (
    <div className="team-detail">
      <h2>Clube de Futebol Exemplo</h2>
      <p>
        Fundado em 1910, o Clube de Futebol Exemplo é um dos times mais tradicionais do país. Com uma rica história de conquistas e uma torcida apaixonada, o clube se consolidou como uma potência no cenário esportivo.
      </p>
      <h3>Títulos Importantes</h3>
      <ul>
        <li>Campeonato Nacional: 10 vezes (1930, 1945, 1960, 1975, 1985, 1995, 2005, 2010, 2015, 2020)</li>
        <li>Copa Nacional: 8 vezes (1940, 1950, 1965, 1980, 1990, 2000, 2010, 2020)</li>
        <li>Campeonato Continental: 3 vezes (1985, 1995, 2015)</li>
      </ul>
      <h3>Feitos Memoráveis</h3>
      <p>
        O clube é conhecido por sua incrível campanha no Campeonato Continental de 2015, onde venceu todos os jogos e conquistou o título de forma invicta. Além disso, o time revelou grandes jogadores que se tornaram ícones do futebol mundial.
      </p>
      <h3>Estádio</h3>
      <p>
        O clube manda seus jogos no Estádio Exemplo, com capacidade para 50.000 torcedores. O estádio é conhecido por sua atmosfera vibrante e pela paixão da torcida.
      </p>
    </div>
  );
};

export default TeamDetail;
